import {StyleSheet} from 'react-native';
export default styles=StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'flex-start',
      padding:20
    },
    orangeButton:{
        borderRadius:12,
        backgroundColor: 'orange',
        padding:12
    },
    title:{
        fontSize:20,
        fontWeight:'bold'
    }
  });
